import { Alert, Box, Button, TextField, Typography } from '@mui/material';
import { useCallback, useEffect, useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useLocalStorage } from 'usehooks-ts';
import { API, getURI } from '../../services';
import { useFetch } from '../../hooks';

interface ILoginBody {
  username: string;
  password: string;
}

interface IApiResponse {
  status: string;
}

const Login = () => {
  const navigate = useNavigate();
  const [isLogged, setIsLogged] = useLocalStorage(
    process.env.REACT_APP_LOGGED_KEY,
    false
  );
  const [loginBody, setLoginBody] = useState<ILoginBody>({
    username: '',
    password: ''
  });
  const {
    doFetch: doLogin,
    data,
    error
  } = useFetch<IApiResponse>({ method: 'POST' });
  const [formError, setFormError] = useState<string | undefined>();
  const [isLoading, setIsLoading] = useState(false);

  useEffect(() => {
    if (isLogged) {
      navigate('/');
    }
  }, [isLogged, navigate]);

  const clearErrorMessage = useCallback(() => setFormError(undefined), []);

  const handleChange = useCallback(
    ({ target }: React.ChangeEvent<HTMLInputElement>) => {
      const { value, name } = target;
      setLoginBody((prevState) => ({
        ...prevState,
        [name]: value.trim()
      }));
      clearErrorMessage();
    },
    [clearErrorMessage]
  );

  const handleLogin = useCallback(() => {
    if (!loginBody.username || !loginBody.password) {
      return setFormError('Preencha os campos corretamente');
    }
    setIsLoading(true);
    doLogin({ url: getURI(API.login), body: loginBody });
  }, [doLogin, loginBody]);

  useEffect(() => {
    if (error) {
      setIsLoading(false);
      setFormError(
        error.message === 'Unauthorized'
          ? 'Usuário ou senha incorretos'
          : error.message
      );
    }
    if (data && data.status === 'ok') {
      setIsLogged(true);
    }
  }, [error, data, setIsLogged]);

  return (
    <Box sx={{ padding: '20px', display: 'flex', flexDirection: 'column' }}>
      <Box sx={{ margin: '20px' }}>
        <Typography variant="h3" mb={2}>
          CPVL
        </Typography>
        <Typography variant="body2">
          Bem-vindo ao portal de serviços administrativos do Clube Poçoscaldense
          de Voo Livre. Entre com o seu usuário e senha para continuar.
        </Typography>
      </Box>

      <Box sx={{ margin: '10px', padding: '10px' }}>
        <TextField
          variant="outlined"
          value={loginBody.username}
          name="username"
          label="Usuário"
          onChange={handleChange}
          onFocus={clearErrorMessage}
          fullWidth
        />
      </Box>
      <Box
        sx={{ margin: '10px', padding: '10px', marginTop: 0, paddingTop: 0 }}
      >
        <TextField
          variant="outlined"
          value={loginBody.password}
          name="password"
          type="password"
          label="Senha"
          onChange={handleChange}
          onFocus={clearErrorMessage}
          fullWidth
        />
      </Box>
      <Button
        disabled={isLoading}
        sx={{ marginLeft: '20px', marginRight: '20px', marginTop: 2 }}
        variant="contained"
        color="primary"
        onClick={handleLogin}
        size="large"
      >
        Entrar
      </Button>

      {formError && (
        <Alert sx={{ margin: '20px' }} severity="error">
          {formError}
        </Alert>
      )}

      <Box sx={{ marginTop: 2, textAlign: 'center' }}>
        <Typography variant="body2">
          <Link to="/rescuePassword" style={{ textDecoration: 'underline' }}>
            <Typography variant="body2" color="primary">Esqueceu a senha?</Typography>
          </Link>
        </Typography>
      </Box>

      <Box sx={{ marginTop: 2, textAlign: 'center' }}>
        <Typography variant="body2">
          Não tem conta?{' '}
          <Link to="/signup" style={{ textDecoration: 'underline' }}>
            <Typography variant="body2" color="primary">Cadastre-se</Typography>
          </Link>
        </Typography>
      </Box>
    </Box>
  );
};
